import React from "react";
import {
	LineChart,
	Line,
	XAxis,
	YAxis,
	CartesianGrid,
	Tooltip,
	Legend,
	ResponsiveContainer,
} from "recharts";

import { GraficoContainer, GraficoTitulo } from "./GraficoElementos";

const Grafico = () => {
	const data = [
		{
			mes: "Janeiro",
			"Robôs Ativo": 4000,
			pv: 2400,
			amt: 2400,
		},
		{
			mes: "Fevereiro",
			"Robôs Ativo": 3000,
			pv: 1398,
			amt: 2210,
		},
		{
			mes: "Março",
			"Robôs Ativo": 2000,
			pv: 9800,
			amt: 2290,
		},
		{
			mes: "Abril",
			"Robôs Ativo": 2780,
			pv: 3908,
			amt: 2000,
		},
		{
			mes: "Maio",
			"Robôs Ativo": 1890,
			pv: 4800,
			amt: 2181,
		},
		{
			mes: "Junho",
			"Robôs Ativo": 2390,
			pv: 3800,
			amt: 2500,
		},
		{
			mes: "Agosto",
			"Robôs Ativo": 3490,
			pv: 4300,
			amt: 2100,
		},
	];

	return (
		<>
			<GraficoContainer>
				<GraficoTitulo>Robôs Ativos</GraficoTitulo>

				<ResponsiveContainer width="100%" aspect={4 / 1}>
					<LineChart data={data}>
						<XAxis dataKey="mes" stroke="#000" />
						<Line type="monotone" stroke="#000" dataKey={"Robôs Ativo"} />
						<Tooltip />
						<Legend />
						<CartesianGrid stroke="#FBFBFB" />
					</LineChart>
				</ResponsiveContainer>
			</GraficoContainer>
		</>
	);
};

export default Grafico;
